class Controller extends Component {
  render() {
    return (
      <div className="row">
          <button type="button" className="btn btn-primary">
            <i className="fas fa-plus fa-fw" />
            Add task
          </button>
            <input type="text" name="txtKeyword" className="form-control" value="" />
      </div>
    );
  }
}

export default Controller;
